import React from 'react';
import './App.css';

function App() {
  let joke = null;

  const onTellJoke = () => {
    console.log("click")
    fetch('https://icanhazdadjoke.com/', {
      method:'GET',
      headers: {
        Accept: 'application/json'
      }
    })
    .then(response => response.json())
    .then(json => {
      joke = json.joke
    })
  }

  return (
    <div>
      <button onClick={onTellJoke} >Tell me a Joke</button>
    </div>
  );
}

export default App;
